import React from 'react';
import ReactDOM from 'react-dom/client';
import './style.css';
import colourPic from './images/colours.jpg';
//import cloud from './images/cloud.png';


const el = document.getElementById('text');
const imgColour = document.getElementById('colour-pic');

const text = ReactDOM.createRoot(el);
const introImg = ReactDOM.createRoot(imgColour);

function Intro(){
  const colourPicStyle= {
    marginTop: "-14vh"

  }
  return <img  style={colourPicStyle} src={colourPic} alt=""/>;
}

function App(){

    return  <p id="descText">Hi, I am Alexandra! Welcome to my digital portfolio resume, where you will find all the information about me, as a professional, as well as the most important projects I have worked on.</p>;

}
introImg.render(<Intro/>);
text.render(<App/>);
